import './App.css';

function App() {
  return (
    <>
      <nav>
        <ul>
          <li><a href="1">About me</a></li>
          <li><a href="2">My projects</a></li>
          <li><a href="3">My skills</a></li>
          <li><a href="4">Contact me</a></li>
        </ul>
      </nav>
      <div className='content'></div>
    </>
  )

}

export default App;
